INSERT INTO `groups` VALUES (2,'BLOX Create','$1,790',37,'Creator','Welcome to BLOX Create\'s official group, a leading gaming and social platform for users across the world.','https://storage.googleapis.com/bloxcity-file-storage/assets/images/BCLogo-Square.png'),(3,'Administrators','$1,790',24,'Creator','Welcome to BLOX Create\'s official administration group. BLOX Create invites all users to join this, it is not restricted to adminsitrators!','https://storage.googleapis.com/bloxcity-file-storage/48e2d3c8175a5c088656b421fa77178a587e08e9410f2.png'),(1,'Namesnipe','$1,790',15,'Creator','Hey, do you have a cool name? So do we! This is Namesnipe where you\'ll be ranked according to how good your username is. The group, was created on the 26th of February in 2017 by the user Nicholas. Names are ranked based on opinion. If, however, you feel that someone has ranked you harshly or accidentally, rejoin the group and contact one of the snipers to re-rank you or post on the group wall. Namesnipes are not names that sound cool. Usernames with unnecessary numbers or letters can be ranked as \'Almost Namesnipes\'. - Prefixes, suffixes and plurals can be ranked no higher than \'Cool Namesnipe\'. Usernames with i\'s and l\'s swapped can be ranked no higher than \'Okay Namesnipe\'. Three character snipes and number snipes have their own rank. If you don\'t recognize a name, Google it first and see how many seemingly relevant results there are.','https://storage.googleapis.com/bloxcity-file-storage/a42890f7323e932cffb263f68efd6f8c58a8d47974ef1.png');
