INSERT INTO `items` VALUES (1,'Pirate','He who sits on the Pirate Throne is shown high obeisance; his influence outweighs the others.','hat','http://i.imgur.com/G242Tht.png','Creator','Feb 26th 2017','Hat.png',15,1),(2,'Traffic Cone','CAUTION: Crazy person wears a traffic cone as a hat! Beware!','hat','http://i.imgur.com/oeOicR8.png','Creator','Feb 26th 2017','cone.png',35,1),(3,'Stetson','This one is just short of being 10 gallons.','hat','http://i.imgur.com/mZr4F9l.png','Creator','Feb 27th 2017','stetson.png',25,1),(4,'Childish Wonder','What better for a child than a helicopter hat?','hat','http://i.imgur.com/ARIt25E.png','Creator','Feb 27th 2017','helicopter.png',10,1),(5,'Beanie','Warm, and stylish!','hat','http://i.imgur.com/EHwGBZ2.png','Creator','Feb 27th 2017','beanie.png',5,1),(6,'Red Top Hat','Red is an awesome color. Especially on a well-rounded top hat.','hat','http://i.imgur.com/G5Icyd8.png','Creator','Feb 27th 2017','red.png',35,1),(7,'Blue Top Hat','Blue is an awesome color. Especially on a well-rounded top hat.','hat','http://i.imgur.com/SrFyBpk.png','Creator','Feb 27th 2017','blue.png',30,1),(8,'Josh\'s Shades','Josh decided it was appropriate to run around the office with a plant on his head screaming \"MAKE ME SHADES!\" until we eventually uploaded them for him, so here is his own personal shades for his awesome asset creation abilities.','hat','http://i.imgur.com/TcfqVgG.png','Creator','Feb 27th 2017','Shades.png',65,1),(9,'Builder Hardhat','You\'ll need it to safely build and scale your awesome games. Always look up!','hat','http://i.imgur.com/YyEDcXr.png','Creator','Feb 27th 2017','Hat2.png',15,1),(10,'Warhelm of Victory','If you are a victor, you shall receive!','hat','http://i.imgur.com/WsxoPMP.png','Creator','Feb 27th 2017','helmpls.png',135,1),(11,'Teapot','The teapot hat is awarded to bug finders on BLOX Create. If you ask for this hat, you most likely do not deserve it. If you receive it, consider it a thank you gift for your bug report.','hat','http://i.imgur.com/h3n2WsR.png','Creator','Feb 27th 2017','teapot.png',615,1),(12,'Female Hair','Only if she dyed her hair, it\'d be long, tan and handsome!','hair','http://i.imgur.com/dmp7Nqe.png','Creator','Feb 27th 2017','female.png',1,1),(13,'Male Hair','Only if he dyed his hair, it\'d be long, tan and handsome!','hair','http://i.imgur.com/x1yzJUU.png','Creator','Feb 27th 2017','male.png',1,1),(14,'Golden Fedora','Sparkly!','hat','http://i.imgur.com/NqTjfH0.png','Creator','Feb 28th 2017','fedora.png',85,1),(15,'BLOX Create Cap','Rewarded to all users who have joined before 2/28/2017','hat','http://i.imgur.com/TncrWnL.png','Creator','Feb 28th 2017','cap.png',0,0),(16,'Businessman','Just a basic clothing','outfit','http://i.imgur.com/mcCyoWK.png','Creator','March 2nd 2017','clothes.png',5,1),(17,'Casual','Just some more basic clothing','outfit','http://i.imgur.com/XGz3FqW.png','Creator','March 3rd 2017','casual.png',5,1),(18,'Builder','Just some more basic clothing','outfit','http://i.imgur.com/Ahcecg5.png','Creator','March 3rd 2017','builder.png',5,1);
